import "./App.css";
import React from "react";
import Home from "./Home";
import Reveal from "./Reveal"
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { useHistory } from "react-router-dom";

function App() {
  let history = useHistory();

  function handleClick(){
    history.push("/");
  }
  return (
    <Router>
      <Switch>
        <Route path="/reveal">
          <Reveal />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
